import { useData } from "../DataContext"; // Import the custom hook

export default function Product() {
    const data = useData(); // Access data from the context

    return (
        <section className="product__block">
            <div className="product__info container flex-double-column">
                <div className="product__title-block flex-double-column">
                    <div className="product__title-element flex-row">
                        <div className="product__name">{data}</div>
                    </div>
                </div>
                <div className="product__price-block flex-double-column"></div>
            </div>
        </section>
    );
}
